      );
       console.log(result.data);
       setSearchData(result.data);
    }
    fetchData();
  }, [])
  return (
    <div>
    <header id="header">
      <p id="logo">민법을 적용하는 법</p>
      <Menubar/>
      </header>
    <nav id="nav">
    {typeof searchData.p_dic === 'undefined' ? (
        <p></p>
        ) : (
            
