            return (
                <li>{n[0] === num ? (
                <Link id ="active-li">{ n[1] }</Link>
            ) : (
            <Link>{ n[1] }</Link>
                
            )}</li>
            )
        })}

        </ul>
        <Paging/>
        </div>
        )}
    </nav>
    <div id="section">
        {typeof searchData.p_dic === 'undefined' ? (
            <p>loading...</p>
        ) : (
            <Tabel p_list={searchData.preceList[0]}/>
        )}
    </div>
